    return (
        <div>
            <h1>Choose Category</h1>
            <div>
                <button className="filmButton">Film/Serie</button>
                <button className="sportButton">Sport</button>
                <button onClick={handleSubmit}>Submit</button>
            </div>
        </div>
    )
}

export default Category;
